    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + ( + col2 ) BETWEEN 90 AND ( + + CAST ( 85 AS REAL ) / - col1 );
  - name: tab2

outputs:
  - name: q218.out
    data: |
      46	51	23
      64	77	40
      75	67	58
